import axios from 'axios'
import { authHeader } from '../helpers/authservice/auth-header';


class BrandDataService {

    getAll() {
        let config = {
            headers: authHeader()
        }
        let data = {
            fields: [],
            sort: [],
            pages: {
                currentpage: 1,
                recordonpage: 30
            }
        }
        return axios.get('/api/v2/brands', config)
    }

    get(id) {
        let config = {
            headers: authHeader()
        }
        return axios.get(`/api/v2/brands/${id}`, config);
    }

    create(data) {
        let config = {
            headers: authHeader()
        }
        console.log(config)
        return axios.post("/api/v2/brands", data, config);
    }

    update(id, data) {
        return axios.put(`/api/v2/brands/${id}`, data);
    }

    delete(id) {
        return axios.delete(`/api/v2/brands/${id}`);
    }

    deleteAll() {
        return axios.delete(`/api/v2/brands`);
    }

    findByTitle(title) {
        return axios.get(`/api/v2/brands?title=${title}`);
    }
}

export default new BrandDataService();
